/** - MAIN CONTROL OF -WHICH F() TO RUN -
 * Function to determine, which card, i.e. which function, needs to be called.
 * Results in displaying normal/small card - the default view at the board.
 */
function renderDummyCard() {
  const cardDiv2 = document.getElementById('column-2');
  const cardDiv3 = document.getElementById('column-3');
  const cardDiv4 = document.getElementById('column-4');
  cardDiv2.innerHTML += renderDummyProgressCard();
  cardDiv3.innerHTML += renderDummyFeedbackCard();
  cardDiv4.innerHTML += renderDummyDoneCard();
}


